import React from "react";

type Skills = {
    name:string,
    group: string,
    icon: string,
    inprogress:boolean
}

const SkillsData: Skills[] = [
  {
    name: "JavaScript",
    group: 'language',
    icon: 'devicon-javascript-plain colored',
    inprogress: false
  },
  {
    name: "TypeScript",
    group: 'language',
    icon: 'devicon-typescript-plain colored',
    inprogress: false
  },
  {
    name: "Django",
    group: 'fremeworks',
    icon: 'devicon-typescript-plain colored',
    inprogress: false
  },
];

export default SkillsData;
